import { Component } from "react";
import getResource from "../actions/GetResource";
import { Container,Row,Col,Button } from "react-bootstrap";
import Transfer from "../actions/Transfer";
import { getapi,header,imgapi } from "../constant"
import "../app.css";
export default class Resource extends Component{
   
    constructor(props){
     super(props) 
     this.state = {data:null,total:0,checkClick:false,transfer:{gr:"",tdata:[]}}
    }
    
    // make selectable
     checkClickfun = (dd)=>{
     if(this.state.checkClick==false){
       this.setState({checkClick:true});
       document.getElementById(dd.id).classList.add("applyonselect")
       console.log(dd)
       if(dd.group==this.state.transfer.gr){
        this.state.transfer.tdata.push(dd)
        this.setState({tdata:this.state.transfer.tdata,gr:dd.group})
       
     
      }else if(dd.group=this.state.transfer.gr && this.state.transfer.tdata!=[]){
       
        this.state.transfer.tdata=[];
        this.state.transfer.tdata.push(dd)
        this.setState({tdata:this.state.transfer.tdata,gr:dd.group})
       }else{
        this.state.transfer.tdata.push(dd)
        this.setState({tdata:this.state.transfer.tdata,gr:dd.group})
        
       }

     }else{
       this.setState({checkClick:false});
       document.getElementById(dd.id).classList.remove("applyonselect")
       let newelm=this.state.transfer.tdata.filter(function(td) { 
        return td !== dd 
       })
       this.setState({tdata:newelm});    
     }
   }
    async componentDidMount(){
      let result=null;
      let resp=null;
      resp = await fetch(getapi,header)
      .then(response => response.json()).then(function(res){
        result =res
       });
       let imgdata=result.imgData;
       let collect=[];
       this.setState({total:result.total});
       for(let i=0;i<this.state.total;i++){
         collect[i] = imgdata[i]
       }
       this.setState({data:collect});
       console.log(collect)
    }

    // setData =  async() => await getResource();

    transferData = ()=>{
    console.log(this.state.transfer.tdata);
     const res =  Transfer(this.state.transfer.tdata);
    
    }
    render(){
      return(
        <Container>  
        <Button variant="primary" className="primary" onClick={this.transferData}>MOVE TO TERMINATOR</Button>
        <div  style={{height:"300px",overflowY:"auto"}}>
          <ul style={{listStyle:"none"}}>
          <Row >     
            {
            this.state.data!==null && this.state.data.map((item) => {
                 let id=item.id
                 let filepath=item.filepath
                 let group=item.group
                 let isclicked = item.isclicked
                 let title = item.title
                 return(item.group=="terminator" ?
                <Col onClick={()=>this.checkClickfun({filepath,group,id,isclicked,title})}  id={item.id}><li><img src={imgapi+item.id} className="img "  /></li> </Col>:"" )
                }) 
            }   
           </Row>

          </ul>
        </div>
        <Button variant="primary" className="primary" onClick={this.transferData}>MOVE TO HUMAN</Button><br />
        <div  style={{height:"300px",overflowY:"auto"}}>
          <ul style={{listStyle:"none"}}>
           <Row style={{marginTop:"10px;"}}> 
           <Row >     
            {
            this.state.data!==null && this.state.data.map((item) => {
              let id=item.id
              let filepath=item.filepath
              let group=item.group
              let isclicked = item.isclicked
              let title = item.title
                return(item.group=="human" ?
                <Col onClick={()=>this.checkClickfun({filepath,group,id,isclicked,title})}  id={item.id}><li><img src={imgapi+item.id} className="img "  /></li> </Col>:"" )
                }) 
            }   
           </Row>
           </Row>

          </ul>
        </div>
        </Container>
      )  
    }
}
